const Header = (props)=>{
  return(
    <div>
      <h1>{props.course}</h1>
    </div>
  )
  }

  //The Part component takes in the parameter props as an object
  // and tells us how the props will be displayed
  // placeholders here!!!!!
const Part = (props)=>{
  return (<p>
    {props.name} {props.exercises}
  </p>);
}

//The Content component gives us corresponding fields
// of the Props in Part component and defines what data will explicitly be displayed
const Content = (props)=>{
  return(
  <div>
    <Part part={props.part1.name} exercise={props.part1.exercises}/>
    <Part part={props.part2.name} exercise={props.part2exercises}/>
    <Part part={props.part3.name} exercise={props.part3.exercises}/>
  </div>
  )
  }

  const Total = (props)=>{ 
    return(
    <div>
      <p>Number of exercises {props.part1.exercises + props.part2.exercises + props.part3.exercises}</p> 
    </div>)}

const App = () => {
 const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }


  return (
    <div>
      <Header course={course} />
      <Content        
        part1={part1}
        exercises1={exercises1}
        part2={part2}
        exercises2={exercises2}
        part3={part3}
        exercises3={exercises3} 
        />
      <Total         
        exercises1={exercises1}
        exercises2={exercises2}
        exercises3={exercises3}

        />
    </div>
  )
}

export default App;
